import axios from 'axios'
import React, { useEffect } from 'react'
const Users = ()=>{


    const data = [];

    useEffect = ()=> {
        axios.get('https://jsonplaceholder.typicode.com/users')
        .then( response =>{


        this.setState({
            data : response.data
        })
        })
    }

        const mapping = ()=> {
            return( data.map( res =>
                <p>{res.id}- {res.name} <br />Email: {res.email}</p>
                )
            )
        }

        return(
                <div className='box'>
                    {this.mapping()}    
                </div>

        )
}


export default Users
